import React from 'react';
import { useEffect, useState } from "react";
import { Link } from 'react-router-dom';
import Form from './Form';
// import GetAll from './Pages/Doctor/GetAll';

function GetAllPatient() {
    const [data, setData] = useState([])

    useEffect(() => {
        const apiurl = "http://localhost:5005/Patients";
        fetch(apiurl)
            .then(res => res.json())
            .then(res => setData(res));
    }, []);


    const foramtedPatient = data.map((pat) => {
        return (
            <>

            <tr>
                <td>{pat.PatientID}</td>
                <td>{pat.PatientName}</td>
                <td>{pat.Phonenumber}</td>
                <td>{pat.Consult}</td>
                   <td>
                   <div className=''>
                        <Link to="Form" className="btn btn-success" >More detail</Link>
                     </div>
                     </td> 
                <td>
                <div className=''>
                        <Link to="Form" className="btn btn-info" >Update</Link>
                     </div>
                </td>
                <td><div className=''>
                        <Link to="Form" className="btn btn-danger" >Delete</Link>
                     </div></td>
            </tr>


            </>
        )
    });


    return (
        <>
            <h1 className='text-center'>our Patient's</h1>

           <div className='align-center'>
            <table className="table-center m-3 border border-black" border={2} style={{height:"160px", width:"1050px", textAlign: "center", borderCollapse: "collapse",align:"center"}}>
                <thead className='text-center'>
                <tr>
                    <th>Patient ID</th>
                    <th>Patient Name</th>
                    <th>Phone Number</th>
                    <th>Consulting Doctor</th>


                </tr>
                </thead>

                {foramtedPatient}

            </table>
            </div>
            <div className='w-25 me-auto ms-3'>
                <Link to="Form" className="btn btn-primary" >Add New Patient</Link>
            </div>

        </>
    )
}


export default GetAllPatient;
